import React from 'react';
import { Link, Page, Text } from '@app/components';

const Error: React.FC = () => {
    return (
        <Page layout="error">
            <Text size="body">
                404 | Page Not Found
            </Text>
            <Link to="ROUTE:HOME">
                GO TO Home
            </Link>
        </Page>
    )
}

export default Error;
